/**
 * Ramp Up Project Backend.
 *
 * A few notes:
 *  - This is meant to be similar to the backend that Nuro will likely provide
 *  - This is meant to be used for learning how to query GraphQL
 *
 * @author Brandon Li <brandon.li@berkeley.edu>
 */

// modules
const { ApolloServer, gql } = require('apollo-server');
const { ApolloError } = require('apollo-server-errors');

// constants
const GRAPH_QL_SCHEMA = gql`

  type Query {

    # mystery test route for learning purposes
    testRoute(int: Int): Int

    # lists pokemon in the pokedex
    listPokemon(input: ListPokemonRequest): ListPokemonResponse
  }

  type Mutation {

    # Registers a trainer
    RegisterTrainer(input: RegisterTrainerRequest): RegisterTrainerResponse
  }

  type Pokemon {
    id: Int!
    name: String!
    type: String!
    totalPoints: Int!
  }

  type Trainer {
    name: String!
  }

  #----

  input ListPokemonRequest {
    type: String
    nameStartsWith: String
    moreThanPoints: Int
    lessThanPoints: Int
  }

  type ListPokemonResponse {
    pokemon: [Pokemon!]!
    trainer: Trainer!
  }

  input RegisterTrainerRequest {
    name: String!
  }

  type RegisterTrainerResponse {
    message: String!
  }
`;

const POKEMON = [
  { id: 1, name: 'Bulbasaur', type: 'Grass', totalPoints: 318 },
  { id: 2, name: 'Ivysaur', type: 'Grass', totalPoints: 405 },
  { id: 3, name: 'Venusaur', type: 'Grass', totalPoints:  525 },
  { id: 4, name: 'Venusaur (Mega Venusaur)', type: 'Grass', totalPoints: 625 },
  { id: 5, name: 'Charmander', type: 'Fire', totalPoints: 309 },
  { id: 6, name: 'Charmeleon', type: 'Fire', totalPoints: 405 },
  { id: 7, name: 'Charizard', type: 'Fire', totalPoints: 534 },
  { id: 8, name: 'Charizard (Mega Charizard X)', type: 'Fire', totalPoints: 634 },
  { id: 9, name: 'Charizard (Mega Charizard Y)', type: 'Fire', totalPoints: 634 },
  { id: 10, name: 'Squirtle', type: 'Water', totalPoints: 314 },
  { id: 11, name: 'Wartortle', type: 'Water', totalPoints: 405 },
  { id: 12, name: 'Blastoise', type: 'Water', totalPoints:   530 },
  { id: 13, name: 'Blastoise (Mega Blastoise)', type: 'Water', totalPoints: 630 },
  { id: 14, name: 'Caterpie', type: 'Bug', totalPoints: 195 },
  { id: 15, name: 'Metapod', type: 'Bug', totalPoints:  205 },
  { id: 16, name: 'Butterfree', type: 'Bug', totalPoints: 395 },
  { id: 17, name: 'Weedle', type: 'Bug', totalPoints: 195 },
  { id: 18, name: 'Kakuna', type: 'Bug', totalPoints: 205 },
  { id: 19, name: 'Beedrill', type: 'Bug', totalPoints: 395 },
  { id: 20, name: 'Beedrill (Mega Beedrill)', type: 'Bug', totalPoints: 495 },
  { id: 21, name: 'Pidgey', type: 'Normal', totalPoints: 251 },
  { id: 22, name: 'Pidgeotto', type: 'Normal', totalPoints:  349 },
  { id: 23, name: 'Pidgeot', type: 'Normal', totalPoints:   479 },
  { id: 24, name: 'Pidgeot (Mega Pidgeot)', type: 'Normal', totalPoints:   579 },
  { id: 25, name: 'Rattata', type: 'Normal', totalPoints:  253 },
  { id: 26, name: 'Rattata (Alolan Rattata)', type: 'Normal', totalPoints: 253 },
  { id: 27, name: 'Raticate', type: 'Normal', totalPoints: 413 }
];

let trainer = null;

// A map of functions which return data for the schema.
const resolvers = {
  Query: {
    testRoute: (_, args) => {
      return mystery(args.int)
    },
    listPokemon: (_, { input }) => {
      if (!trainer) {
        throw new ApolloError('Must register trainer name first', 'INTERNAL_SERVER_ERROR');
      }

      if (input === null) {
        return { pokemon: POKEMON, trainer: { name: trainer } };
      }

      let pokemon = POKEMON

      if (input.type) {
        pokemon = pokemon.filter(a => a.type === input.type)
      }
      if (input.nameStartsWith) {
        pokemon = pokemon.filter(a => a.name.toLowerCase().startsWith(input.nameStartsWith.toLowerCase()))
      }
      if (input.moreThanPoints) {
        pokemon = pokemon.filter(a => a.totalPoints > input.moreThanPoints)
      }
      if (input.lessThanPoints) {
        pokemon = pokemon.filter(a => a.totalPoints < input.lessThanPoints)
      }

      return {
        pokemon: pokemon,
        trainer: { name: trainer }
      }
    }
  },
  Mutation: {
    RegisterTrainer: (_, { input }) => {
      trainer = 'Trainer ' + input.name;
      return { message: `Successfully registered ${input.name}!` }
    }
  }
};

const server = new ApolloServer({
  typeDefs: GRAPH_QL_SCHEMA,
  resolvers
});

server.listen().then(({ url }) => {
  console.log(`ðŸš€ Server ready at ${url}`);
});


